<script>
  import EventBus from '../../bus'
  import cart from '../../products'
  import html2canvas from "html2canvas"
  import jsPDF from 'jspdf'
  import 'jspdf-autotable'
  export default {
    components: {},
    data() {
      return {
        data: [],
        products: [],
        arrayQuantity: [],
        arrayQuantityDom: [],
        counter: 0,
        totalPrice: [],
        totalPriceDom: [],
        total: 0,
        totalDom: 0,
        loading: false
      }
    },
    methods: {
      css(){
        var element = document.getElementById('element-to-print');
        var imgData = 
          "data:image/png;base64,";

        var doc = new jsPDF();

        doc.setFontSize(30);
        doc.text("Proyectos Puga", 110, 20, null, null, "center");
        doc.text("Cotización", 110, 30, null, null, "center");
        doc.setFontSize(15);
        doc.setFont("courier");
        doc.setFontStyle("normal");
        doc.text("Av. Ciro Purata #100 Col. Cuauhtémoc CP. 79040", 110, 40, null, null, "center");
        doc.text("(481) - 381 80 97", 110, 45, null, null, "center");
        doc.addImage(imgData, "JPEG", 20, 20, 20, 15);

        var bodyarray = []
        for (let i = 0; i < this.products.length; i++) {
          bodyarray.push([this.products[i].name, this.arrayQuantity[i], this.products[i].price,this.products[i].price_dom, this.totalPrice[i],this.totalPriceDom[i]])
        }      

        doc.autoTable({
          cursor: { x: 110, y: 50},
          head: [['Producto', 'cantidad', 'precio','precio dom' , 'total','total dom' ]],
          body: bodyarray,
          startY: 55
        })

        doc.autoTable({
          head: [['Total', 'Total domicilio' ]],
          body: [
            [this.total.toFixed(2),this.totalDom.toFixed(2)]
            // ...
          ],
          columnStyles: {
              0: {
                  columnWidth: 50
              }
          }
        })  
        doc.save("cotizacion.pdf");
      },
      watchSelected(event, price,price_dom, index) {
        if (this.totalPrice.length == this.data.length) {
          var quantity = event.target.options[event.target.selectedIndex].value;
          var priceTotal = price * quantity;
          this.totalPrice.splice(index, 1, priceTotal)
          this.arrayQuantity.splice(index, 1, parseInt(quantity))
          
          var priceTotalDom = price_dom * quantity;
          this.totalPriceDom.splice(index, 1, priceTotalDom)
          this.arrayQuantityDom.splice(index, 1, parseInt(quantity))
        } else {
          var quantity = event.target.options[event.target.selectedIndex].value;
          var priceTotal = price * quantity;
          this.arrayQuantity.splice(index, 1, parseInt(quantity))
          this.totalPrice.splice(index, 1, priceTotal)

          var priceTotalDom = price_dom * quantity;
          this.arrayQuantity.splice(index, 1, parseInt(quantity))
          this.totalPrice.splice(index, 1, priceTotalDom)
        }
        this.getPriceTotal()
        this.getPriceTotalDom()
      },
      getPriceTotal() {
        var suma = 0
        var sumaPro = 0
        for (let i = 0; i < this.totalPrice.length; i++) {
          suma = suma + parseFloat(this.totalPrice[i])
        }
        for (let i = 0; i < this.arrayQuantity.length; i++) {
          sumaPro = sumaPro + parseFloat(this.arrayQuantity[i])
        }
        this.totalProduct = sumaPro
        this.total = suma
        // console.log(this.products);
      },
      getPriceTotalDom() {
        var suma = 0
        var sumaPro = 0
        for (let i = 0; i < this.totalPriceDom.length; i++) {
          suma = suma + parseFloat(this.totalPriceDom[i])
        }
        this.totalDom = suma
      },
      async getShopping() {
        // 1 block y 5 cal
        
        for (let i = 0; i < this.data.length; i++) {
          for (let j = 0; j < cart.length; j++) {
            if (cart[j].id == this.data[i]) {
              this.products.push(cart[j])
            }
          }
        }
        this.getPrice()
      },
      getPrice() {
        for (let i = 0; i < this.data.length; i++) {
          this.totalPrice.push(parseFloat(this.products[i].price))
          this.totalPriceDom.push(parseFloat(this.products[i].price_dom))
        }
        this.getPriceTotal()
        this.getPriceTotalDom()
      },
      clearProduct(id, index) {
        var newArray = this.data.filter(function(i) {
          return i !== id
        }); // filtramos
        console.log('asu');
        
        localStorage.setItem('shopping', JSON.stringify(newArray));
        this.total = 0
        this.data = JSON.parse(localStorage.getItem('shopping'))
        EventBus.$emit('shoppingCart')
        this.arrayQuantity.splice(index, 1)
        this.getShopping()
        this.getPriceTotal()
        location.reload();
      }
    },
    computed: {
    },
    created() {
      this.data = JSON.parse(localStorage.getItem('shopping'));
      if (this.data !== null) {
        this.getShopping()
        for (let i = 0; i < this.data.length; i++) {
          this.arrayQuantity.push(1)
        }
      }
    },
    mounted() {
    }
  }
</script>